p=A.bP("\u0625\u064a\u0632\u064a \u0644\u064a\u0631\u0646\u064a\u0646\u062c \u0644\u0639\u0628\u0629 \u062a\u0639\u0644\u064a\u0645\u064a\u0629 \u062a\u0641\u0627\u0639\u0644\u064a\u0629 \u062a\u0639\u062a\u0645\u062f \u0639\u0644\u0649 \u0627\u0644\u0648\u0627\u0642\u0639 \u0627\u0644\u0645\u0639\u0632\u0632 \u0648\u0627\u0644\u062a\u0639\u0644\u0645 \u0627\u0644\u0622\u0644\u064a \u0644\u064a\u062a\u0639\u0631\u0641 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u0639\u0644\u0649 \u0627\u0644\u062d\u064a\u0648\u0627\u0646\u0627\u062a \u0628\u0637\u0631\u064a\u0642\u0629 \u0645\u0645\u062a\u0639\u0629. \u064a\u0645\u0643\u0646 \u0627\u062e\u062a\u064a\u0627\u0631 \u0627\u0644\u062d\u064a\u0648\u0627\u0646 \u0623\u0648 \u0645\u0633\u062d\u0647 \u0645\u0646 \u0627\u0644\u0643\u062a\u0627\u0628 \u0644\u064a\u0638\u0647\u0631 \u0628\u0634\u0643\u0644 \u062b\u0644\u0627\u062b\u064a \u0627\u0644\u0623\u0628\u0639\u0627\u062f \u0645\u0639 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0648\u0635\u0648\u062a \u0648\u0623\u0633\u0626\u0644\u0629 \u062a\u062d\u0641\u064a\u0632\u064a\u0629. \u064a\u062f\u0639\u0645 \u0627\u0644\u062a\u0637\u0628\u064a\u0642 \u0627\u0644\u0639\u0631\u0628\u064a\u0629 \u0648\u0627\u0644\u0625\u0646\u062c\u0644\u064a\u0632\u064a\u0629 \u0648\u064a\u0642\u062f\u0645 \u0645\u0633\u0627\u0631\u064b\u0627 \u062a\u0639\u0644\u064a\u0645\u064a\u064b\u0627 \u0645\u0634\u0648\u0642\u064b\u0627 \u0645\u0639 \u0645\u0624\u062b\u0631\u0627\u062a \u0628\u0635\u0631\u064a\u0629 \u0648\u0635\u0648\u062a\u064a\u0629.","Easy Learning is an interactive AR-powered educational game designed for children to explore and learn about animals in a fun and immersive way. The app combines Augmented Reality, Machine Learning, and Flutter to simulate real-life animal interaction. Children can either select an animal from a list or scan an image from a companion book to view the animal in 3D AR. Each animal comes with detailed information, its natural sound, and an engaging quiz to test the child\u2019s understanding.\n\nWhen a child answers questions correctly, they are rewarded with cheerful applause sounds and visual celebrations (like falling confetti), and the next animal is unlocked. Wrong answers trigger playful error sounds and prompt retry attempts. The app supports both Arabic and English languages, and includes a gamified learning path with motivational audio-visual feedback. While the quiz path unlocks educational content and progress, children can still explore animals freely by scanning them from the physical book, even without completing quizzes.\n\nThis project reflects a deep integration of AR and Flutter\u2014an uncommon and challenging combination\u2014and demonstrates creative use of cutting-edge educational technology tailored for young learners.")
